sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
  var powerConsumption= (inputs.consumption * 365) + (0.3 * (0.3 * inputs.consumption)) * (inputs.country_specific_emission * inputs.pue);
  outputs.power_consumption= powerConsumption;

})(inputs, outputs);

